import React  from "react";
import Navbar from "../components/Navbar";
// import Skills from "../components/Skills";
// import { Link } from "react-router-dom";
import '../style/splash.css'

const Splash = () =>{

    const {styles} = {
        "background-color": "lightgray",
        "width": "500px",
        "height": "300px"
    };


    const highlight1=()=>{
        var box1 = document.getElementsByClassName("skill1");
        console.log(box1[0])
        Object.assign(box1[0].style, styles);
        console.log('hello')
    }



    return (

        <div className="splash-container">
            <Navbar/>
            <div className="splash-wrap">

                <div className="splash-left">
                    <div className='splash-welcome'>
                        Hi, I'm
                        Alex <br/>
                        a Full Stack Software engineer.


                    </div>      
                 </div>
                <div className="splash-right">
                    <div className="project-squares">
                        <div id="project1"onMouseEnter={ ()=>{ highlight1()} }>A</div>
                        <div id="project2">B</div>
                        <div id="project3">C</div>
                        <div id="project4">D</div>
                    </div>
                 </div>

            </div>


        </div>
    )
}
export default Splash
